En este libro, Cynthia Edul pinta su aldea para pintar el mundo. Es decir, cuenta su Siria familiar para armarnos el mapa geopol√≠tico de ese pa√≠s en la actualidad y c√≥mo, la Siria que vieron sus ojos por √∫ltima vez, dej√≥ de existir para siempre.

