{'pk': 17879513788437421, 'user_id': 3721545173, 'text': '‚ÄúApollo me mira, con el ce√±o fruncido. De ojo a ojo. ¬øQu√© piensan los perros cuando ven llorar a alguien? Criados para dar consuelo, nos econdortan. Pero qu√© desconcertante ha de ser la infelicidad humana para ellos. Nosotros, que podemos llenar nuestros platos en cualquier momento y con tanta comida como queramos, que podemos salir cuando nos apetezca y obrar con libertad ‚Äìnosotros que no tenemos un amo que necesita que le satisfagan u obedezcan constantemente-‚Ä¶ ¬øQu√© demonios?‚Äù
Tras el suicidio de su mejor amigo escritor, la protagonista de esta novela ‚Äìtambi√©n escritora- hereda a su perro. La historia del duelo por la p√©rdida se mezcla con la de esta en principio obligada y creciente compa√±√≠a. ‚ÄúEl amigo‚Äù no es un libro sobre la amistad entre el perro y el hombre (en este caso, la mujer) ni tampoco podr√≠amos resumirlo en la frase trillada que reza que ‚Äúel perro es el mejor amigo del hombre‚Äù.
Este libro es una conversaci√≥n imaginaria que la protagonista tiene con su amigo ausente. Un recorrido por esa amistad plagada de secretos, pactos rotos y escena literaria neoyorkina. Pero ‚ÄúEl amigo‚Äù es, sobre todo, un tratado sobre literatura y sobre cu√°nto de la vida se le puede prestar a la literatura para escribir un libro.
Un libro para escritores, amantes de la literatura, de la amistad, de los perros y de la vida.

